);

class App extends React.Component {
  render() {
    return (
      <div className='App'>
        <Route exact path='/' component={HomePage}/>
        <Route exact path='/hats' component={hatspage}/>
        {/* <HomePage /> */}
      </div>
    );
  }
}

export default App;
